import React from 'react';
import { createRoot } from 'react-dom/client';
import './index.css';

function App() {
    function getData(){
        console.log('Привет МИР!')
    }
    return <div><button onClick={getData}>Click me!</button></div>
}

createRoot(document.getElementById('root')!).render(
  //<React.StrictMode>
      <App/>
  //</React.StrictMode>
);

function Adm() {
    return <div>101</div>
}

createRoot(document.getElementById('adm')!).render(
    <Adm/>
);
